(181, 59, '07/25/2018', 'Benefits of Hiring a Divorce Attorney', 'divorce attorney coon rapids', 'Child support is one of the main issues that can be decided when it comes to divorce. Child support are regular payments that are made by one parent to the other.   Despite the concept of child support seemingly being simple to understand, there are misconceptions associated with it that can cause problems when it comes to the divorce. So, letâ€™s take a look at them and clear up questions commonly asked.   Child Support is Optional  Many people think that child support is an option after a divorce and not something you have to do if you donâ€™t want to. Well, depending on the ruling in your divorce, if you are ordered to pay child support it can be a criminal offense not to pay.  This means you must keep up with your payments or face consequences for it.  The amount you pay for child support will be calculated based on your income, as well as insurance costs, childcare costs, and the amount of time the child is in your care.  Once set by the court, this is the amount you need to pay; it is not optional.   Child Support is only for Food and Clothing  It is often assumed that child support is for the basics that are needed, such as food and clothing. While this is somewhat true, child support is typically used to ensure the lifestyle of the kids after the divorce.    Child Support can be Deducted on Taxes  You would be surprised how many parents think that paying child support can be deducted from their taxes every year. Unfortunately, this not true and simply a myth. Even if you pay a substantial amount of child support every month, this will not be considered as part of your taxes nor can be classed as part of the income of the other parent that is receiving child support.  There is no doubt that the issue of child support can get complicated. If you find there are problems receiving or coming to a conclusion on the amount of child support that will be due, you can contact a family law attorney to help you. With their wealth of experience and knowledge, a family law attorney can advise you on what your next steps are and what you are expected to pay for child support. The most important thing is to make sure that the wellbeing of the child is supported after a divorce and the best way to ensure this is with legal help from a family law attorney during the divorce process.', 1, 1, 1, '2018-07-25 19:52:27', '2018-07-25 19:52:27'),
